import "../CSS/taskItem.css";
function TaskItem({ onClose, open, title, description }) {
  return (
    <Modal modalLable="Task Item" onClose={onClose} open={open}>
      <div className="taskItem">
        <h2>{title}</h2>
        <p>{description}</p>

        <button ></button>
      </div>
    </Modal>
  );
}

export default TaskItem;
